using log4net;
using SOE.Core;
using SOE.Interfaces;
using FreeRealms;
using System;
using System.Threading;


namespace Gateway.Login
{
    public static class LoginManager
    {
        private static ILog _log;

        private static SOEServer _server;

        public static void Start(SOEServer soeServer = null)
        {
            _server = soeServer ?? Gateway.Server;

            _log = _server.Logger.GetLogger("LoginManager");

            _log.Info("Service constructed");
        }

        private static byte[] StringToByteArray(string hex)
        {
            Thread.Sleep(100);
            byte[] array = new byte[hex.Length / 2];
            for (int i = 0; i < hex.Length; i += 2)
            {
                array[i / 2] = Convert.ToByte(hex.Substring(i, 2), 16);
            }
            return array;
        }

        [SOEMessageHandler("PacketLogin", ClientGatewayBasePackets.PacketLogin, "CGAPI_527")]
        public static void HandleLoginRequest(SOEClient soeClient, SOEMessage message)
        {
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketClientIsHosted, StringToByteArray("0700"))).GetFinalSOEMessage(soeClient));
            SendLoginReply(soeClient);
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* PacketInitializationParameters */ "0500010A000000A600040000006C697665"))).GetFinalSOEMessage(soeClient));
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* PacketSendZoneDetails */ "050001270000002B000C0000004661626C65645265616C6D73020000000000000000000000000000050000000000"))).GetFinalSOEMessage(soeClient));
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* PacketClientGameSettings */ "05000113000000900004000000070000000C010000010000803F"))).GetFinalSOEMessage(soeClient));
            //soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* AnnouncementDataSendPacket */ "05000140000000C10002010000008B0000000100000078BA0000A3DE4D000000000077070000040000004578697405000000506172616D00000000000000000000000000000000"))).GetFinalSOEMessage(soeClient));
            //soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* AnnouncementDataSendPacket */ "05000140000000C10002010000008B0000000100000078BA0000A3DE4D000000000077070000040000004578697405000000506172616D00000000000000000000000000000000"))).GetFinalSOEMessage(soeClient));
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* PlayerUpdatePacketItemDefinitions */ ""))).GetFinalSOEMessage(soeClient));
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* SendSelfToClient */ ""))).GetFinalSOEMessage(soeClient));
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(""))).GetFinalSOEMessage(soeClient));
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* PacketPointOfInterestDefinitionReply */ ""))).GetFinalSOEMessage(soeClient));
            //soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* PacketPOIChangeMessage */ "0500010E0000006800AB0D00000500000023010000"))).GetFinalSOEMessage(soeClient));
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* ZoneDoneSendingInitialData */ "050001020000000E00"))).GetFinalSOEMessage(soeClient));
            SendClientBeginZoning(soeClient);
            soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* ZoneDoneSendingInitialData */ "050001020000000E00"))).GetFinalSOEMessage(soeClient));
            ClientUpdatePacketDoneSendingPreloadCharacters(soeClient);
            //soeClient.SendMessage(new SOEWriter(new SOEMessage(ClientGatewayBasePackets.PacketTunneledClientPacket, StringToByteArray(/* EncounterOverworldCombatPacket */ "0500010D00000029008400000000000000000001"))).GetFinalSOEMessage(soeClient));
        }

        public static void SendClientBeginZoning(SOEClient soeClient)
        {
            SOEWriter beginZoning = new SOEWriter(BasePackets.PacketClientBeginZoning, true);
            beginZoning.AddASCIIString("FabledRealms");
            beginZoning.AddHostUInt32(2u);
            /* Sanctuary Spawn */
            beginZoning.AddFloat(-1474.5752f); // Y
            beginZoning.AddFloat(-35.42862f); // Z
            beginZoning.AddFloat(390.74472f); // X
            /* Snowhill Spawn */
            //beginZoning.AddFloat(57.21518f); // Y
            //beginZoning.AddFloat(32.185225f); // Z
            //beginZoning.AddFloat(365.125812f); // X
            /* Merry Vale Spawn */
            //beginZoning.AddFloat(-1175.521412f); // Y
            //beginZoning.AddFloat(-35.529778f); // Z
            //beginZoning.AddFloat(-430.532132f); // X
            /* Sunstone Valley Spawn */
            //beginZoning.AddFloat(700f); // Y
            //beginZoning.AddFloat(100f); // Z
            //beginZoning.AddFloat(1700f); // X
            beginZoning.AddFloat(0f);
            for (uint num = 0u; num < 4; num++)
            {
                beginZoning.AddHostUInt32(20 * num);
            }
            beginZoning.AddASCIIString("Settings");
            beginZoning.AddBoolean(value: false);
            beginZoning.AddByte(2);
            beginZoning.AddHostUInt32(16u);
            beginZoning.AddHostUInt32(4u);
            beginZoning.AddHostUInt32(5u);
            beginZoning.AddBoolean(value: false);
            beginZoning.AddBoolean(value: false);
            byte[] raw = beginZoning.GetRaw();
            SOEWriter tunneledClient = new SOEWriter(ClientGatewayBasePackets.PacketTunneledClientPacket, true);
            tunneledClient.AddBoolean(value: false);
            tunneledClient.AddHostUInt32((uint)raw.Length);
            tunneledClient.AddBytes(raw);
            soeClient.SendMessage(tunneledClient.GetFinalSOEMessage(soeClient));
        }

        public static void SendLoginReply(SOEClient soeClient)
        {
            var loginReply = new SOEWriter(ClientGatewayBasePackets.PacketLoginReply, true);

            loginReply.AddBoolean(true);

            var rawBytes = loginReply.GetRaw();

            var tunneledClient = new SOEWriter(ClientGatewayBasePackets.PacketTunneledClientPacket, true);

            tunneledClient.AddBoolean(true);
            tunneledClient.AddHostUInt32((uint)rawBytes.Length);

            tunneledClient.AddBytes(rawBytes);

            soeClient.SendMessage(tunneledClient.GetFinalSOEMessage(soeClient));
        }

        public static void ClientUpdatePacketDoneSendingPreloadCharacters(SOEClient soeClient)
        {
            var baseClientUpdate = new SOEWriter((ushort)BasePackets.BaseClientUpdatePacket, true);

            baseClientUpdate.AddHostUInt16((ushort)BaseClientUpdatePacket.ClientUpdatePacketDoneSendingPreloadCharacters);

            baseClientUpdate.AddBoolean(false);

            var rawBytes = baseClientUpdate.GetRaw();

            var tunneledClient = new SOEWriter((ushort)ClientGatewayBasePackets.PacketTunneledClientPacket, true);

            tunneledClient.AddBoolean(true);
            tunneledClient.AddHostUInt32((uint)rawBytes.Length);

            tunneledClient.AddBytes(rawBytes);

            soeClient.SendMessage(tunneledClient.GetFinalSOEMessage(soeClient));
        }

        public static void SendEncounterOverworldCombat(SOEClient soeClient)
        {
            var baseEncounter = new SOEWriter(BasePackets.BaseEncounterPacket, true);

            baseEncounter.AddHostUInt16(BasePackets.BaseEncounterPackets.EncounterOverworldCombatPacket);

            baseEncounter.AddHostUInt32(0);
            baseEncounter.AddHostUInt32(0);
            baseEncounter.AddBoolean(true);

            var rawBytes = baseEncounter.GetRaw();

            var tunneledClient = new SOEWriter(ClientGatewayBasePackets.PacketTunneledClientPacket, true);

            tunneledClient.AddBoolean(true);
            tunneledClient.AddHostUInt32((uint)rawBytes.Length);

            tunneledClient.AddBytes(rawBytes);

            soeClient.SendMessage(tunneledClient.GetFinalSOEMessage(soeClient));
        }

    }
}